@import './kenzolizeCSS/index.scss';

// ----------------------------------------------------------------
// BODY
// ----------------------------------------------------------------

.container {
	background: radial-gradient(at top, $color-2 10px, $color-1 60%);
}

// ----------------------------------------------------------------
// MAIN HEADER
// ----------------------------------------------------------------

.main-header {
	&.logo-link {
		color: $color-4;
		border: $color-4 5px solid;
		padding: 0.5rem;
		width: 200px;
		text-decoration: none;
		margin: 6rem auto 8rem auto;
		display: block;
	}
}

// ----------------------------------------------------------------
// MAIN CONTENT
// ----------------------------------------------------------------

.main-content {
	background: $color-4;
	width: 100%;
	padding: 4rem 0;

	@each $size, $values in $screen-sizes {
		@media screen and (min-width: map-get($screen-sizes , 'l', 'breakpoint' )) {
			padding: 4rem 0;
		}
		@media screen and (max-width: map-get($screen-sizes , 'm', 'breakpoint' )) {
			padding: 3rem 2rem;
		}
		&.post {
			@media screen and (min-width: map-get($screen-sizes , 'l', 'breakpoint' )) {
				padding: 4rem 0 0 0;
			}
		}

		&.content-framed {
			background: $color-4;
			padding: 8rem 2rem;
			@media screen and (min-width: map-get($screen-sizes , 'l', 'breakpoint' )) {
				padding: 8rem 5rem;
			}
		}
		.main-title {
			margin-bottom: 2rem;
			font-size: 2.5rem;
			@media screen and (min-width: map-get($screen-sizes, 's', 'breakpoint')) {
				font-size: 2.5rem;
			}
			@media screen and (min-width: map-get($screen-sizes, 'm', 'breakpoint')) {
				font-size: 3rem;
				display: flex;
				justify-content: center;
				gap: 1rem;
			}
			@media screen and (min-width: map-get($screen-sizes, 'l', 'breakpoint')) {
				font-size: $font-size-h1;
				display: block;
			}
		}
	}
}

// ----------------------------------------------------------------
// MAIN FOOTER
// ----------------------------------------------------------------

.main-footer {
	background: rgba(242, 243, 244);
	ul {
		list-style: none;
	}
	input,
	textarea {
		margin: 1.5rem 0 1rem 0;
		background: none;
	}
	form {
		border-right: 3px solid $color-4-darken;
		padding: 3rem;
	}
	address {
		padding: 3rem 4rem;
		border-bottom: 3px solid $color-4-darken;
		li:not(:last-of-type) {
			margin-right: 4rem;
		}
		@media screen and (min-width: map-get($screen-sizes, 'xs', 'breakpoint')) {
			padding-left: 0;
			margin-left: 0;
		}
	}
	.social {
		padding: 3rem 4rem;
		border-bottom: 3px solid $color-4-darken;
		.list-icon {
			margin-left: 2rem;
			a {
				margin-bottom: 0.5rem;
				align-items: center;
			}
		}
		@media screen and (min-width: map-get($screen-sizes, 'xs', 'breakpoint')) {
			padding-left: 0;
			margin-left: 0;
		}
	}
}

// TEXT

.text-title {
	span {
		letter-spacing: 0.1rem;
	}
}

// HEADERS

.headers-title {
	span {
		letter-spacing: 0.1rem;
	}
}

// HEADING WITH A SUBTITLE

.sub-1 {
	font-style: italic;
	margin: -10px 0 32px 0;
	font-size: 0.9em;
}
.sub-2 {
	font-style: italic;
	margin: -10px 0 32px 0;
	font-size: 0.8em;
}
.sub-3 {
	font-style: italic;
	margin: -10px 0 32px 0;
	font-size: 0.7em;
}
.sub {
	margin-bottom: 40px;
}

// IMAGE

.img-full {
	width: 100%;
}

.img-9 {
	gap: 0.6rem;
	img {
		display: block;
		width: 100%;
	}
}

.float-left {
	width: 50%;
	float: left;
	margin: 0.5rem 1rem 0 0;
}
.float-right {
	width: 50%;
	float: right;
	margin: 0.5rem 0 0 1rem;
}
.title-lr {
	margin: 0.8rem 0;
}

// ----------------------------------------------------------------
// FOOTER
// ----------------------------------------------------------------

.footer-content-copyright {
	margin: 3rem 0 6rem 0;
	text-align: center;
	color: $color-3;
	a {
		color: $color-3;
	}
	a:hover {
		color: $color-4;
	}
}
.h6 {
	letter-spacing: 0.1rem;
}
